const fields = {
    username: {
        label: 'User name',
        name: 'name',
        type: 'text',
        required: true,
        placeholder: 'User name'
    },

    email: {
        label: 'User email',
        name: 'email',
        type: 'email',
        required: true,
        placeholder: 'User email'
    },

    password: {
        label: 'User password',
        name: 'password',
        type: 'password',
        required: true,
        placeholder: 'User password'
    }

}

export default fields;
